import React from 'react'

const Button = ({onClick , className, type= "button",full= false, children,...props}) => {
  return (
    <div>
        <button
            type = {type} 
            onClick= {onclick}
            className={`${className}`}{...props}>
            {children}</button>
    </div>
  )
}

export default Button
